import{_ as a,c as r,o as t,ah as s}from"./chunks/framework.Dp_r5Pqh.js";const u=JSON.parse('{"title":"Scraper Data","description":"","frontmatter":{"prev":{"text":"Download Excel Template","link":"/documentation/site/site-excel-template"},"next":{"text":"Site Settings","link":"/documentation/site/site-settings"}},"headers":[],"relativePath":"documentation/site/site-scraper-data.md","filePath":"documentation/site/site-scraper-data.md","lastUpdated":1751799890000}'),o={name:"documentation/site/site-scraper-data.md"};function i(n,e,l,d,c,p){return t(),r("div",null,[...e[0]||(e[0]=[s('<h1 id="scraper-data" tabindex="-1">Scraper Data <a class="header-anchor" href="#scraper-data" aria-label="Permalink to “Scraper Data”">​</a></h1><p>Scraper Data is a specialized section that stores and manages data collected from scraper field types. When you use scraper field types in your forms, the extracted data is automatically stored here and can be downloaded for further use or analysis.</p><h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to “Overview”">​</a></h2><p>The Scraper Data section provides:</p><ul><li><strong>📊 Data Storage</strong> - Stores scraped data from scraper field types</li><li><strong>📥 Download Options</strong> - Multiple download formats for scraped data</li><li><strong>🔄 Data Management</strong> - View, refresh, and delete scraped data</li><li><strong>📋 Data Organization</strong> - Organize scraped data for easy access</li></ul><h2 id="when-scraper-data-appears" tabindex="-1">When Scraper Data Appears <a class="header-anchor" href="#when-scraper-data-appears" aria-label="Permalink to “When Scraper Data Appears”">​</a></h2><h3 id="🎯-prerequisites" tabindex="-1">🎯 Prerequisites <a class="header-anchor" href="#🎯-prerequisites" aria-label="Permalink to “🎯 Prerequisites”">​</a></h3><p>Scraper Data section becomes available when:</p><ul><li><strong>✅ Scraper Field Types Used</strong> - You have configured scraper field types in your forms</li><li><strong>✅ Data Successfully Scraped</strong> - The scraper field types have successfully extracted data</li><li><strong>✅ Data Storage Enabled</strong> - The extension has stored the scraped data</li><li><strong>✅ Site Configuration Complete</strong> - Your site and forms are properly configured</li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>if using <a href="/documentation/form-fields/field-types.html#scraper-data">Supported Field Types</a> then Scraper Data section will be available.</p></div><h2 id="scraper-data-interface" tabindex="-1">Scraper Data Interface <a class="header-anchor" href="#scraper-data-interface" aria-label="Permalink to “Scraper Data Interface”">​</a></h2><h3 id="🖥️-interface-overview" tabindex="-1">🖥️ Interface Overview <a class="header-anchor" href="#🖥️-interface-overview" aria-label="Permalink to “🖥️ Interface Overview”">​</a></h3><p>The Scraper Data section provides a clean interface for managing your scraped data:</p><ul><li><strong>📊 Data Display</strong> - View all scraped data in an organized format</li><li><strong>📥 Download Buttons</strong> - Multiple download options for different needs</li><li><strong>🔄 Management Tools</strong> - Refresh and delete data as needed</li><li><strong>📋 Status Information</strong> - Clear indication of data availability</li></ul><h2 id="download-options" tabindex="-1">Download Options <a class="header-anchor" href="#download-options" aria-label="Permalink to “Download Options”">​</a></h2><h3 id="📥-download-scraper-data" tabindex="-1">📥 Download Scraper Data <a class="header-anchor" href="#📥-download-scraper-data" aria-label="Permalink to “📥 Download Scraper Data”">​</a></h3><p><strong>Purpose:</strong> Download all scraped data in a comprehensive format <strong>Format:</strong> Complete dataset with all scraped information <strong>Use Case:</strong> Full data analysis and comprehensive reporting</p><h3 id="📥-download-scraper-data-single-sheet" tabindex="-1">📥 Download Scraper Data Single Sheet <a class="header-anchor" href="#📥-download-scraper-data-single-sheet" aria-label="Permalink to “📥 Download Scraper Data Single Sheet”">​</a></h3><p><strong>Purpose:</strong> Download scraped data in a simplified single-sheet format <strong>Format:</strong> Condensed data in a single Excel sheet <strong>Use Case:</strong> Quick data review and simple analysis</p><h3 id="🔄-refresh-data" tabindex="-1">🔄 Refresh Data <a class="header-anchor" href="#🔄-refresh-data" aria-label="Permalink to “🔄 Refresh Data”">​</a></h3><p><strong>Purpose:</strong> Update scraped data with the latest information <strong>Action:</strong> Re-runs scraper field types to get fresh data <strong>Use Case:</strong> When source data has changed or been updated</p><h3 id="🗑️-delete-data" tabindex="-1">🗑️ Delete Data <a class="header-anchor" href="#🗑️-delete-data" aria-label="Permalink to “🗑️ Delete Data”">​</a></h3><p><strong>Purpose:</strong> Remove all scraped data from storage <strong>Action:</strong> Permanently deletes stored scraper data <strong>Use Case:</strong> Clearing old data or starting fresh</p><h2 id="how-to-generate-scraper-data" tabindex="-1">How to Generate Scraper Data <a class="header-anchor" href="#how-to-generate-scraper-data" aria-label="Permalink to “How to Generate Scraper Data”">​</a></h2><h3 id="🔧-prerequisites" tabindex="-1">🔧 Prerequisites <a class="header-anchor" href="#🔧-prerequisites" aria-label="Permalink to “🔧 Prerequisites”">​</a></h3><p>Before you can access scraper data, you need to:</p><ol><li><strong>Configure Scraper Field Types</strong> - Set up scraper field types in your forms</li><li><strong>Run Form Automation</strong> - Execute the form filling process to scrape data</li><li><strong>Verify Data Extraction</strong> - Ensure scraper field types successfully extracted data</li><li><strong>Check Data Storage</strong> - Confirm data is stored in the scraper data section</li></ol><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to “Troubleshooting”">​</a></h2><h3 id="❌-common-issues" tabindex="-1">❌ Common Issues <a class="header-anchor" href="#❌-common-issues" aria-label="Permalink to “❌ Common Issues”">​</a></h3><p><strong>Issue:</strong> &quot;Scraper Data Not Available&quot; message appears <strong>Solutions:</strong></p><ul><li>Ensure you have configured scraper field types in your forms</li><li>Run the form automation process to generate scraped data</li><li>Check if scraper field types are properly configured</li><li>Verify that data extraction was successful</li></ul><p><strong>Issue:</strong> No data appears after running automation <strong>Solutions:</strong></p><ul><li>Check scraper field type configuration</li><li>Verify CSS selectors or XPath expressions are correct</li><li>Test scraper field types individually</li><li>Check the extension log for error messages</li></ul><p><strong>Issue:</strong> Download buttons are not working <strong>Solutions:</strong></p><ul><li>Ensure data is available in the scraper data section</li><li>Check browser download permissions</li><li>Try refreshing the page and data</li><li>Verify data storage is working properly</li></ul><h3 id="🔧-data-issues" tabindex="-1">🔧 Data Issues <a class="header-anchor" href="#🔧-data-issues" aria-label="Permalink to “🔧 Data Issues”">​</a></h3><p><strong>Issue:</strong> Incomplete or missing data <strong>Solutions:</strong></p><ul><li>Review scraper field type selectors</li><li>Check if source page structure has changed</li><li>Verify data extraction patterns</li><li>Test with different data sources</li></ul><p><strong>Issue:</strong> Data formatting problems <strong>Solutions:</strong></p><ul><li>Check data processing rules in scraper field types</li><li>Verify data type configurations</li><li>Review data cleaning settings</li><li>Test with sample data first</li></ul><h2 id="support-and-help" tabindex="-1">Support and Help <a class="header-anchor" href="#support-and-help" aria-label="Permalink to “Support and Help”">​</a></h2><p>If you need assistance with scraper data:</p><ul><li>Check the <a href="/documentation/log.html">Log</a> for detailed error information</li><li>Review <a href="/documentation/form-fields/field-types.html">Field Types</a> for scraper field configuration</li><li>Visit our <a href="/documentation/#need-help">Support Channels</a> for community assistance</li><li>Report issues on our <a href="https://github.com/jeevan-lal/excellent-data-filler-docs/issues" target="_blank" rel="noreferrer">GitHub Repository</a></li></ul><h2 id="next-steps" tabindex="-1">Next Steps <a class="header-anchor" href="#next-steps" aria-label="Permalink to “Next Steps”">​</a></h2><p>After setting up scraper data:</p><ul><li><a href="/documentation/form-fields/field-types.html">Field Types Guide</a> - Learn about different field types</li><li><a href="/documentation/form/form.html">Form Configuration</a> - Configure forms to use scraper data</li><li><a href="/documentation/functions.html">Data Management</a> - Advanced data processing functions</li><li><a href="/documentation/structure.html">Automation Workflow</a> - Set up complete automation workflows</li></ul>',46)])])}const f=a(o,[["render",i]]);export{u as __pageData,f as default};
